import React from 'react';
import lang from "../src/Images/Component 1 – 1.png";


const Navbar=()=>{
    return (
        <>
<div className="container-fluid Component-33-1">
        <div className="row">
        <img src={lang}

     class="Component-1-1"></img>
     <div className='no'>
     
         <p className="no"><i class="fa fa-phone fa-2 rem"></i> &nbsp; +91 88821-40688  |  +91 90840-63259</p>
     </div>
        </div>
</div>
        </>
    );
};
export default Navbar;
